/*Table structure for table `login_accessories` */

DROP TABLE IF EXISTS `login_accessories`;

CREATE TABLE `login_accessories` (
  `id` varchar(11) COLLATE utf8_unicode_ci NOT NULL,
  `identity_photo_t` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身份证图的正面',
  `identity_photo_f` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身份证图的反面',
  `logo` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'logo',
  `licence_scan` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '营业执照副本',
  `works_scan` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '作品截图',
  `qualification` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '资格证书',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `login_accessories` */

LOCK TABLES `login_accessories` WRITE;

