/*Table structure for table `login_company` */

DROP TABLE IF EXISTS `login_company`;

CREATE TABLE `login_company` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `business_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '公司名称',
  `resume` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '公司简介',
  `licence_num` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '营业执照注册号',
  `licence_site` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '营业执照所在地',
  `corporate_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '法人名字',
  `corporate_identity` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '法人身份证号',
  `contacts_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '法人姓名',
  `contacts_phone` int(11) DEFAULT NULL COMMENT '联系人电话',
  `mail` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '电子邮箱',
  `address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '公司联系地址',
  `company_phoneNumber` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '公司电话',
  `developer_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `developer_phone` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `capital` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '注册资本',
  `accessories_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `login_company` */

LOCK TABLES `login_company` WRITE;

UNLOCK TABLES;

/*Table structure for table `login_personal` */

DROP TABLE IF EXISTS `login_personal`;

CREATE TABLE `login_personal` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '姓名',
  `identity_card` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身份证号',
  `resume` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '简介',
  `company_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '公司名称',
  `contacts_phone` int(11) DEFAULT NULL COMMENT '联系人电话',
  `mail` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '电子邮箱',
  `address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '地址',
  `works_href` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '作品展示地址',
  `accessories_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `login_personal` */

LOCK TABLES `login_personal` WRITE;

UNLOCK TABLES;

/*Table structure for table `login_user` */

DROP TABLE IF EXISTS `login_user`;

CREATE TABLE `login_user` (
  `id` varchar(50) NOT NULL COMMENT '主键ID',
  `username` varchar(100) DEFAULT NULL COMMENT '登录名',
  `password` varchar(100) DEFAULT NULL COMMENT '密码',
  `status` int(11) DEFAULT '0' COMMENT '审核状态',
  `ref_id` int(11) DEFAULT NULL COMMENT '用户引用ID',
  `user_type` int(10) NOT NULL COMMENT '用户类型[0 ：个人用户 1：企业用户 2：管理员用户]',
  `login_flag` int(10) DEFAULT NULL COMMENT '是否可登录',
  `login_mark` varchar(64) DEFAULT NULL COMMENT '用于单点登录的随机字符串验证',
  `create_by` varchar(50) DEFAULT NULL COMMENT '来源',
  `create_date` bigint(20) NOT NULL COMMENT '创建时间',
  `update_by` varchar(50) DEFAULT NULL COMMENT '更新者',
  `update_date` bigint(20) DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `agreement_num` int(11) DEFAULT NULL COMMENT '签订的协议编号',
  `del_flag` int(10) DEFAULT '0' COMMENT '删除标记',
  `register_status` int(11) DEFAULT '0' COMMENT '0未激活, 1激活, 2冻结',
  `current_time_sendEmail` bigint(20) DEFAULT '0' COMMENT '发送邮件的时间戳',
  `random` varchar(20) DEFAULT '""' COMMENT '发送邮件要使用的随机字符串',
  `last_login_time` date DEFAULT NULL COMMENT '用户最后登陆时间',
  `company_id` varchar(50) DEFAULT NULL COMMENT '企业用户表主键',
  `personal_id` varchar(50) DEFAULT NULL COMMENT '个人用户表主键',
  KEY `sys_user_login_name` (`username`) USING BTREE,
  KEY `sys_user_update_date` (`update_date`) USING BTREE,
  KEY `sys_user_del_flag` (`del_flag`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表';

