  `update_time` bigint(20) DEFAULT NULL COMMENT '修改时间',
  `password` varchar(20) DEFAULT NULL COMMENT '推送协商密码',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

